import React from 'react';
import styles from './Navbar.module.css'
import {observer} from "mobx-react-lite";
import Selected from "../../../components/selected/Selected";

const Navbar = observer(({types, ...props}) => {
    return (
        <div>
            {types.map((item) => {
                return (
                    <Selected
                        key={item.id}
                        onClick={() => props.setBrand(item)}
                        isActive={item.id == props.selectedBrandId}>
                        {item.name}
                    </Selected>
                )
            })}
        </div>
    );
});

export default Navbar;
